package com.example.listcustomer;

import javax.servlet.RequestDispatcher;
import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

@WebServlet(name = "ListServlet", value = "/ListServlet")
public class ListServlet extends HttpServlet {
    @Override
    protected void doGet(HttpServletRequest req, HttpServletResponse resp) throws ServletException, IOException {
        List<Customer> customerList = new ArrayList<>();
        customerList.add(new Customer("Huong","29/09/1995","Ha Nam","data:image/jpeg;base64,"));
        customerList.add(new Customer("Long","15/01/2000","Ha Noi", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Hien","NA","Thai Binh", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Nam","21/08/1983","Bac Giang","data:image/jpeg;base64,"));
        RequestDispatcher requestDispatcher = req.getRequestDispatcher("index.jsp");
        req.setAttribute("customer", customerList);
        requestDispatcher.forward(req,resp);
    }
}
